import React from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Logout = () => {
    const navigate = useNavigate();

    const handleLogout = async () => {
        try {
            // Gọi API để thực hiện logout từ server
            await axios.post("http://localhost:8080/api/users/logout");

            // Điều hướng đến trang đăng nhập hoặc trang chính (tùy thuộc vào yêu cầu của bạn)
            navigate('/login');
        } catch (error) {
            console.error("Logout failed:", error);
            // Xử lý lỗi nếu cần
        }
    };

    return (
        <div>
           <div class="product-small col has-hover out-of-stock product type-product post-58460 status-publish first outofstock product_cat-ao-mixi has-post-thumbnail shipping-taxable purchasable product-type-variable">
	<div class="col-inner">

<div class="badge-container absolute left top z-1">
</div>
	<div class="product-small box ">
		<div class="box-image">
			<div class="image-fade_in_back">
				<a href="https://shop.mixigaming.com/san-pham/ao-logo-2023/">
					<img width="300" height="400" src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04433-300x400.jpg" class="attachment-woocommerce_thumbnail size-woocommerce_thumbnail" alt="Duy04433" decoding="async"/>
                        <img width="300" height="400" src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04430-300x400.jpg" class="show-on-hover absolute fill hide-for-small back-image" alt="Duy04430" decoding="async"/>				</a>
			</div>
			<div class="image-tools is-small top right show-on-hover">
							</div>
			<div class="image-tools is-small hide-for-small bottom left show-on-hover">
							</div>
			<div class="image-tools grid-tools text-center hide-for-small bottom hover-slide-in show-on-hover">
							</div>
			<div class="out-of-stock-label">Hết hàng</div>		</div>

		<div class="box-text box-text-products text-center grid-style-2">
			<div class="title-wrapper">		<p class="category uppercase is-smaller no-text-overflow product-cat op-7">
			ÁO MIXI		</p>
	<p class="name product-title woocommerce-loop-product__title"><a href="https://shop.mixigaming.com/san-pham/ao-logo-2023/" class="woocommerce-LoopProduct-link woocommerce-loop-product__link">Áo logo 2023</a></p></div><div class="price-wrapper">
	<span class="price"><span class="woocommerce-Price-amount amount"><bdi>270,000&nbsp;<span class="woocommerce-Price-currencySymbol">₫</span></bdi></span></span>
</div>		</div>
	</div>
		</div>
</div>
        </div>
    );
};

export default Logout;
